import React, { useState, useEffect } from 'react'

import { Card, Col, Form, Row, Button } from 'react-bootstrap';
import { faSave } from '@fortawesome/free-solid-svg-icons';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'

const Register = (props) => {

    const [details, setDetails] = useState({ firstName: "", lastName: "", email: "", password: "" });

    useEffect(() => {
        console.log(details);
    });

    const handleSubmit = (evt) => {
        evt.preventDefault();
        console.log(details.lastName, details.firstName);
    }

    const handleInputChange = (e) => {
        setDetails(
            {
                [e.target.name]: e.target.value
            }
        );
    }

    return (
        <Card className="border">
            <Card.Header style={{ fontSize: '2rem', fontWeight: 'bold' }}>
                <FontAwesomeIcon icon={faSave} style={{ color: '#e2821d' }} />  Registration
            </Card.Header>

            <Card.Title className="mb-1 p-3">Please provide us with the following information:</Card.Title>
            <Form onSubmit={handleSubmit} id="registerFormId">
                <Card.Body>
                    <Row>
                        <Col lg={6} md={6}>
                            <Form.Group className="mb-3" controlId="formBasicFirstName">
                                <Form.Label>First name:</Form.Label>
                                <Form.Control type="text" placeholder="Enter first name" name="firstName" 
                                onChange={handleInputChange} required />
                            </Form.Group>
                        </Col>
                        <Col lg={6} md={6}>
                            <Form.Group className="mb-3" controlId="formBasicLastName">
                                <Form.Label>Last name:</Form.Label>
                                <Form.Control type="text" placeholder="Enter last name" name="lastName"
                                onChange={handleInputChange} required />            {/* onChange={e => setDetails({lastName: e.target.value})} */}
                            </Form.Group>
                        </Col>
                    </Row>

                    <Row>
                        <Col lg={6} md={6}>
                            <Form.Group className="mb-3" controlId="formBasicEmail">
                                <Form.Label>Email address:</Form.Label>
                                <Form.Control type="email" placeholder="name@example.com" name="email" required />
                            </Form.Group>
                        </Col>
                        <Col lg={6} md={6}>
                            <Form.Group className="mb-3" controlId="formBasicPassword">
                                <Form.Label>Password:</Form.Label>
                                <Form.Control type="password" placeholder="Enter password" name="password" required />
                            </Form.Group>
                        </Col>
                    </Row>
                </Card.Body>
                <Card.Footer>
                    <div className="d-flex justify-content-end">
                        <Button style={{ width: '130px' }} variant="primary">Clear</Button>
                        <Button type="submit" style={{ width: '130px' }} className="ms-3" variant="success">Register</Button>
                    </div>
                </Card.Footer>
            </Form>
        </Card>
    )
}

export default Register
